import React from 'react'
import { Link } from 'react-router-dom';


    const NavAdmin = () => {

        const navAdminStyle = {
            marginTop: '10px',
            width: '10px'
        }

        return (
            <ul class="nav nav-tabs">
            <li class="nav-item">
              <Link class="nav-link active" to="adminreservation">Reservations</Link>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="#">Clients</a>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="#">Questions</a>
            </li>
            <li class="nav-item">
              <a class="nav-link disabled" href="#" tabindex="-1" aria-disabled="true">Google</a>
            </li>
          </ul>
        )
    }



export default NavAdmin;
